import React from "react";
import { createStructuredSelector } from "reselect";
import { connect } from "react-redux";

import { selectRentalsForPreview } from "../../redux/rental/rental.selectors";

import RentalCategory from "../rental-category/rental-category";

const RentalOverview = ({ rentals }) => (
  <RentalOverview className="rental-overview">
    {/* {console.log(rentals)} */}
    {rentals === undefined
      ? null
      : rentals.map(({ id, ...otherRentalProps }) => (
          <RentalCategory key={id} {...otherRentalProps} />
        ))}
    {/* {console.log(rentals)} */}
  </RentalOverview>
);

const mapStateToProps = createStructuredSelector({
  rentals: selectRentalsForPreview,
});

export default connect(mapStateToProps)(RentalOverview);
